caption:
@wawa_gatheru is an environmental justice advocate, writer and current graduate student at the University of Oxford. She is a first generation American of Kenyan descent and the first Black person in history to receive the Rhodes, Truman and Udall Scholarships. She's also the founder of @blackgirlenvironmentalist. 

"As an environmental justice advocate, advocating for and protecting people + planet includes my own body, my temple... There was a time where I did not think SPF was as necessary for me, as I am a dark skinned Black woman... I see protecting my skin as an integral part of showing myself the love I deserve."

Stay tuned for more from Wawa! 🌎

@oliver_english is a Filmmaker, Chef & Food Advocate. Originally from Boston, he grew up in his family's restaurant business and has been intimately involved in the world of food ever since. He co-founded @commontablecreative and now works with some of the world's leading food companies, NGOs and nonprofits to advance global food, sustainability, and social justice issues.

"Over the years, I have grown to love and appreciate spending more and more time outside, connected to nature. Whether we are out filming all day on a farm, biking to meetings, or prepping for a dinner... SPF gives me the flexibility and protection to spend much of the day outside. And when we feel more connected to our world, we feel a greater obligation to protect her."

Stay tuned for more from Oliver! 🌱

@chungfury.md is a board-certified dermatologist specializing in cutaneous oncology - the practice of recognizing, preventing, treating, and understanding the science behind skin cancer. Dr. Chung also serves as Chief Medical Officer of the American Ultimate Disc League (AUDL) and is the majority owner of the league’s Philadelphia Phoenix franchise!

"Wearing SPF is important for so many reasons! Number one is that prevention is 100% the name of the game... For me, personally, being a person of color, and especially one that loves being active, SPF is the single best defense against dark spots, wrinkles, and, well, aging in general!"

Stay tuned for more from Christina! ☀️ #everysingleday

@susan.a.korn is the NYC based founder of @susan_alexandra. She is passionate about creating dazzle - whether it’s a signature beaded bag, intricate jewelry or a drinking glass.

"Being free and active is so important to me. I live in NYC, a city where you’re constantly on the go and running around. When I wear my protective layer of Supergoop! sunscreen, I feel like I’m protected and free."

Stay tuned for more from Susan! ✨ #everysingleday

@hunterjoness is a professional surfer from the South Bay of Los Angeles. Fueled by nature, adrenaline & self expression, Hunter’s always stayed true to his passions.

"On a daily basis I spend several hours outdoors surfing in the ocean. It’s important for me to know I’m staying protected from the sun, taking care of my skin and using the best products to do so!" 

Stay tuned for more from Hunter! 🏄🏾‍♂️ #everysingleday
